import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Dashboard from "./webpages/Dashboard";
import Dashboard2 from "./webpages/Dashboard2";
import Forms from "./webpages/Forms";
import Homepage from "./webpages/Homepage";
import Login from "./webpages/Login";
import Movie from "./webpages/Movie";
import Navigation from "./webpages/Navigation";
import Products from "./webpages/Products";
import Registration from "./webpages/Registration";
import Subscription from "./webpages/Subscription";
import User from "./webpages/User";

const App = () => {
  return (
    <BrowserRouter>
      <Router>
        <Routes>
          <Navigation />
          <Route key="/dashboard" path="/dashboard" element={<Dashboard />} />
          <Route
            key="/dashboard2"
            path="/dashboard2"
            element={<Dashboard2 />}
          />
          <Route key="/forms" path="/forms" element={<Forms />} />
          <Route key="/" path="/" element={<Homepage />} />
          <Route key="/login" path="/login" element={<Login />} />
          <Route key="/movie" path="/movie" element={<Movie />} />
          <Route
            key="/navigation"
            path="/navigation"
            element={<Navigation />}
          />
          <Route
            key="/registration"
            path="/registration"
            element={<Registration />}
          />
          <Route
            key="/subscription"
            path="/subscription"
            element={<Subscription />}
          />
        </Routes>
      </Router>
    </BrowserRouter>
  );
};

export default App;
